import React, {Component} from 'react'
import {Link} from 'react-router-dom'

class WelcomeComponent extends Component {
    render() {
        return (
            <>
          <div className="container">
            <h1> JJLZ!</h1>
            <h1> ---------------</h1>
                <h3> John</h3>
                <h3> Jonathan</h3>
                <h3> Levan</h3>
                <h3> Zeyad</h3>

            </div>
             
               
            </>
        )        
    }
}
export default WelcomeComponent
